// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

import "@openzeppelin/contracts/access/AccessControl.sol";

contract KeyPoster is AccessControl {
    // Define roles as constant bytes32 variables
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");

    // Mapping to store Ethereum wallet addresses and the block number they were added
    mapping(address => uint256) public addressToBlock;

    // Array to store addresses
    address[] public addressList;

    // Events
    event AddressAdded(address indexed _address, uint256 _block);
    event AddressRemoved(address indexed _address);
    event AdminAssigned(address indexed _admin);

// Constructor
constructor() {}

    // Function to initialize roles
    function initialize(address defaultAdmin) public {
        require(defaultAdmin != address(0), "Invalid address");

        // Grant the DEFAULT_ADMIN_ROLE to the defaultAdmin
        grantRole(DEFAULT_ADMIN_ROLE, defaultAdmin);

        // Set ADMIN_ROLE's admin to be DEFAULT_ADMIN_ROLE
        _setRoleAdmin(ADMIN_ROLE, DEFAULT_ADMIN_ROLE);

        // Grant ADMIN_ROLE to the defaultAdmin
        grantRole(ADMIN_ROLE, defaultAdmin);
    }




    // Modifier to allow only owner and admins to write to the contract
    modifier onlyOwnerOrAdmin() {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender) || hasRole(ADMIN_ROLE, msg.sender), "Not authorized");
        _;
    }

    // Function to check if an address is an admin
    function isAdmin(address _address) public view returns (bool) {
        return hasRole(ADMIN_ROLE, _address);
    }

    // Function to add an address to the contract
    function addAddress(address _address) public onlyOwnerOrAdmin {
        require(_address != address(0), "Invalid address");
        uint256 codeLength;
        assembly { codeLength := extcodesize(_address) }
        require(codeLength == 0, "Contracts are not allowed");

        addressToBlock[_address] = block.number;
        addressList.push(_address);
        emit AddressAdded(_address, block.number);
    }

    // Function to remove an address from the contract
    function removeAddress(address _address) public onlyOwnerOrAdmin {
        require(addressToBlock[_address] != 0, "Address does not exist");
        delete addressToBlock[_address];

        for (uint256 i = 0; i < addressList.length; i++) {
            if (addressList[i] == _address) {
                addressList[i] = addressList[addressList.length - 1];
                addressList.pop();
                break;
            }
        }

        emit AddressRemoved(_address);
    }

    // Function to assign an admin
    function assignAdmin(address _admin) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Not authorized");
        require(_admin != address(0), "Invalid address");
        grantRole(ADMIN_ROLE, _admin);
        emit AdminAssigned(_admin);
    }

    // Function to check if an address exists in the list
    function addressExists(address _address) public view returns (bool) {
        return addressToBlock[_address] != 0;
    }

    // Function to get all stored addresses
    function getAllAddresses() public view returns (address[] memory) {
        return addressList;
    }
}

